import React, { useState, useEffect } from 'react';
import { Container, TextField, MenuItem, Button, List, ListItem, ListItemText, IconButton } from '@mui/material';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';

function App() {
  const [totalAmount, setTotalAmount] = useState(500);
  const [users, setUsers] = useState([]);
  const [items, setItems] = useState([]);
  const [selectedUsers, setSelectedUsers] = useState([]);
  const [selectedItems, setSelectedItems] = useState([]);
  const [preview, setPreview] = useState([]);
  const [grandTotal, setGrandTotal] = useState(0);
  const [editUserId, setEditUserId] = useState(null);

  useEffect(() => {
    fetch('/users.json')
      .then(response => response.json())
      .then(data => setUsers(data));

    fetch('/items.json')
      .then(response => response.json())
      .then(data => setItems(data));
  }, []);

  const handleSave = () => {
    if (editUserId !== null) {
      const updatedPreview = preview.map(p => 
        p.user === editUserId ? 
          { user: editUserId, items: selectedItems.map(itemId => items.find(i => i.id === itemId)), total: selectedItems.reduce((sum, itemId) => sum + items.find(i => i.id === itemId).price, 0) } 
          : p
      );
      setPreview(updatedPreview);
      setEditUserId(null);
    } else {
      const newPreview = selectedUsers.map(user => {
        const userItems = selectedItems.map(item => items.find(i => i.id === item));
        const total = userItems.reduce((sum, item) => sum + item.price, 0);
        return { user, items: userItems, total };
      });
      setPreview([...preview, ...newPreview]);
    }

    const grandTotal = preview.reduce((sum, { total }) => sum + total, 0);
    setGrandTotal(grandTotal);
  };

  const handleEdit = (user) => {
    const userPreview = preview.find(p => p.user === user);
    setSelectedUsers([user]);
    setSelectedItems(userPreview.items.map(item => item.id));
    setEditUserId(user);
  };

  const handleDelete = (user) => {
    const newPreview = preview.filter(p => p.user !== user);
    setPreview(newPreview);
    const grandTotal = newPreview.reduce((sum, { total }) => sum + total, 0);
    setGrandTotal(grandTotal);
  };

  return (
    <Container>
      <h1>Cafeteria</h1>
      <TextField
        label="Total Amount"
        type="number"
        value={totalAmount}
        onChange={(e) => setTotalAmount(e.target.value)}
        fullWidth
        margin="normal"
      />
      <TextField
        select
        label="Select Users"
        value={selectedUsers}
        onChange={(e) => setSelectedUsers(e.target.value)}
        SelectProps={{
          multiple: true,
        }}
        fullWidth
        margin="normal"
      >
        {users.map(user => (
          <MenuItem key={user.id} value={user.id}>
            {user.name}
          </MenuItem>
        ))}
      </TextField>
      <TextField
        select
        label="Select Food Items"
        value={selectedItems}
        onChange={(e) => setSelectedItems(e.target.value)}
        SelectProps={{
          multiple: true,
        }}
        fullWidth
        margin="normal"
      >
        {items.map(item => (
          <MenuItem key={item.id} value={item.id}>
            {item.name}
          </MenuItem>
        ))}
      </TextField>
      <Button variant="contained" color="primary" onClick={handleSave}>
        {editUserId !== null ? 'Update' : 'Save'}
      </Button>
      <div>
        <h2>Preview</h2>
        <List>
          {preview.map(({ user, items, total }, index) => (
            <ListItem key={index}>
              <ListItemText
                primary={`User: ${users.find(u => u.id === user).name}`}
                secondary={`Items: ${items.map(item => `${item.name} (${item.price})`).join(', ')} - Total: ${total}`}
              />
              <IconButton edge="end" aria-label="edit" onClick={() => handleEdit(user)}>
                <EditIcon />
              </IconButton>
              <IconButton edge="end" aria-label="delete" onClick={() => handleDelete(user)}>
                <DeleteIcon />
              </IconButton>
            </ListItem>
          ))}
        </List>
        <h3>Grand Total: {grandTotal}</h3>
      </div>
    </Container>
  );
}

export default App;
